CREATE TABLE IF NOT EXISTS data(
   number             VARCHAR(17) NOT NULL PRIMARY KEY
  ,priority           VARCHAR(12)
  ,state              VARCHAR(19) NOT NULL
  ,short_description  VARCHAR(160) NOT NULL
  ,assignment_group   VARCHAR(25) NOT NULL
  ,configuration_item VARCHAR(29) NOT NULL
  ,task_type          VARCHAR(14) NOT NULL
  ,opened             DATETIME  NOT NULL
);
